import React from 'react';
import "./InformationBox.css";
import {
    Card,
    CardContent,
    Typography
} from "@material-ui/core"
function InformationBox({title, cases, total,active, isRed, ...props }) {
    return (
        <Card
            onClick={props.onClick}
            className={`informationBox ${active && "informationBox-selected"} ${
                isRed && "informationBox-red"
            }`}
            >
            <CardContent>
                {/* Title*/}
                <Typography className="informationBox_title" color="textSecondary">{title}</Typography>

                {/* cases*/}
                <h2 className="informationBox_case">{cases}</h2>

                {/* total*/}
                <Typography className="informationBox_total" color="textSecondary">Total {total}</Typography>

            </CardContent>
        </Card>

    )
}

export default InformationBox
